const tintColor = "#f4d693";

export default {
  tintColor,
  tabIconDefault: "#3399cc",
  tabIconSelected: tintColor,
  tabBar: "#ffffff",
  errorBackground: "#e37980",
  errorText: "#fff",
  warningBackground: "#eca400",
  warningText: "#666804",
  noticeBackground: tintColor,
  noticeText: "#fff",
};
